import{_ as e,c as a,o as r,a5 as t}from"./chunks/framework.CTkMpXT2.js";const g=JSON.parse('{"title":"What can I do for remoteStorage?","description":"","frontmatter":{},"headers":[],"relativePath":"contribute.md","filePath":"contribute.md"}'),o={name:"contribute.md"},i=t('<h1 id="what-can-i-do-for-remotestorage" tabindex="-1">What can I do for remoteStorage? <a class="header-anchor" href="#what-can-i-do-for-remotestorage" aria-label="Permalink to &quot;What can I do for remoteStorage?&quot;">​</a></h1><h2 id="i-can-code" tabindex="-1">I can code <a class="header-anchor" href="#i-can-code" aria-label="Permalink to &quot;I can code&quot;">​</a></h2><h3 id="javascript" tabindex="-1">JavaScript <a class="header-anchor" href="#javascript" aria-label="Permalink to &quot;JavaScript&quot;">​</a></h3><ul><li>Integrate RS in any of your apps. More apps means more users, means more developers, means more apps.</li><li>Help out with the <a href="https://github.com/remotestorage/remotestorage.js/" target="_blank" rel="noreferrer">reference client</a>. There are always <a href="https://github.com/remotestorage/remotestorage.js/issues" target="_blank" rel="noreferrer">issues</a> to work on</li><li>Help with completing and improving the remoteStorage.js <a href="./rs.js/docs/">documentation</a> (even if it&#39;s just questions or feedback). There is more detailed information about how to <a href="./rs.js/docs/contributing/docs.html">contribute to the documentation</a>.</li><li>Contribute to any open-source remoteStorage app. Some of them are <a href="/apps.html" title="Apps">listed here</a>.</li><li>Help improving and creating new remoteStorage.js <a href="https://github.com/remotestorage/modules" target="_blank" rel="noreferrer">data modules</a></li><li>Help improving <a href="https://github.com/remotestorage/armadietto/" target="_blank" rel="noreferrer">Armadietto</a>, a maintained RS server based on node.js</li></ul><h3 id="php" tabindex="-1">PHP <a class="header-anchor" href="#php" aria-label="Permalink to &quot;PHP&quot;">​</a></h3><ul><li>Help out with <a href="https://git.sr.ht/~fkooman/php-remote-storage" target="_blank" rel="noreferrer">php-remote-storage</a>, a remoteStorage server written in PHP</li></ul><h3 id="rust" tabindex="-1">Rust <a class="header-anchor" href="#rust" aria-label="Permalink to &quot;Rust&quot;">​</a></h3><ul><li>Contribute to <a href="https://github.com/untitaker/mysteryshack" target="_blank" rel="noreferrer">Mysteryshack</a>, a light-weight, fast, self-contained RS server</li></ul><h3 id="ruby" tabindex="-1">Ruby <a class="header-anchor" href="#ruby" aria-label="Permalink to &quot;Ruby&quot;">​</a></h3><ul><li>There is a maintained RS server implementation written in Ruby, consisting of an <a href="https://gitea.kosmos.org/kosmos/akkounts/" target="_blank" rel="noreferrer">accounts management app and UI</a> based on Rails, and a <a href="https://github.com/5apps/liquor-cabinet" target="_blank" rel="noreferrer">RS HTTP API based on Sinatra</a></li><li>There&#39;s an <a href="https://github.com/remotestorage/api-test-suite" target="_blank" rel="noreferrer">integration test suite</a> for testing local and/or live remoteStorage servers for API compliance, which is written in Ruby (minitest/spec).</li></ul><h3 id="java" tabindex="-1">Java <a class="header-anchor" href="#java" aria-label="Permalink to &quot;Java&quot;">​</a></h3><ul><li>We&#39;d like to create an Android sync adapter that synchronizes calendars and contacts. See <a href="https://community.remotestorage.io/t/synchronization-with-carddav-caldav/307/4" target="_blank" rel="noreferrer">this thread</a> if you would like to help.</li><li>Create an Android app that integrates sharing, for e.g. URLs to the bookmarks category, or images to the shares module.</li></ul><h3 id="c" tabindex="-1">C <a class="header-anchor" href="#c" aria-label="Permalink to &quot;C&quot;">​</a></h3><ul><li>There&#39;s a <a href="https://github.com/remotestorage/fuse" target="_blank" rel="noreferrer">remoteStorage FUSE module</a> for mounting storages as filesystems, which needs upgrading to newer protocol versions and finishing in general.</li><li>There&#39;s a <a href="https://github.com/remotestorage/rs-serve" target="_blank" rel="noreferrer">remoteStorage server</a> written in C (with a little node.js helper app), which needs upgrading and has some installation issues.</li></ul><h2 id="i-can-design" tabindex="-1">I can design <a class="header-anchor" href="#i-can-design" aria-label="Permalink to &quot;I can design&quot;">​</a></h2><ul><li>Improve the design of this website. The website repo is located at <a href="https://github.com/remotestorage/website" target="_blank" rel="noreferrer">https://github.com/remotestorage/website</a></li><li>Help improve the design of any RS-enabled open source (see e.g. <a href="/apps.html">apps</a>). Or design a new one and find a developer to help you with implementing it.</li></ul><h2 id="i-can-write" tabindex="-1">I can write <a class="header-anchor" href="#i-can-write" aria-label="Permalink to &quot;I can write&quot;">​</a></h2><ul><li>Add and/or improve content of the RS website, or any other project-related content on the Web.</li><li>Help us improve existing technical documentation. e.g. the <a href="./rs.js/docs/">remoteStorage.js docs</a></li><li>Help improve documentation, description and marketing materials for RS-enabled open-source <a href="/apps.html">apps</a> and <a href="/servers.html">servers</a>.</li><li>Write about remoteStorage on your website, blog, social media, etc.. Explain</li><li>the concept to users, developers, providers, and anyone else you think should know about remoteStorage&#39;s existence and how it works.</li><li>Improve the language and clarity of the <a href="https://github.com/remotestorage/spec" target="_blank" rel="noreferrer">protocol specification</a></li></ul><h2 id="i-can-run-servers" tabindex="-1">I can run servers <a class="header-anchor" href="#i-can-run-servers" aria-label="Permalink to &quot;I can run servers&quot;">​</a></h2><ul><li>Set up a <a href="/servers.html">server</a> for yourself and maybe your family and friends!</li><li>Become a commercial or non-profit storage provider. You can either implement your own or use <a href="/servers.html">existing server</a> software as your basis.</li></ul><h2 id="i-can-test-things" tabindex="-1">I can test things <a class="header-anchor" href="#i-can-test-things" aria-label="Permalink to &quot;I can test things&quot;">​</a></h2><ul><li>Use RS-enabled <a href="/apps.html">apps</a> and/or <a href="/servers.html">servers</a> and report issues and constructive feedback.</li></ul>',22),n=[i];function s(l,h,c,d,u,m){return r(),a("div",null,n)}const f=e(o,[["render",s]]);export{g as __pageData,f as default};
